const Card = () =>{
    return(
        <div>
            <img alt ='robots' src ='https://robohash.org/1?size=200x200'/>
            <div>
                <h2>Jane Dong</h2>
                <p>jane@gmail.com</p>
            </div>
        </div>
    );
}

export default Card;
